reateElement("p",null,"The Intel collaboration will focus on the recently announced open source ",g.a.createElement("a",{href:"https://github.com/intelsdi-x/snap"},"Snap cloud telemetry agent"),". Snap provides a central access point for applications like Grafana to tap underlying platform attributes to more efficiently assign services to optimized infrastructure. The companies will work together to build solutions to expose, store, visualize, and alert on deep platform telemetry from both infrastructure and applications. These fully-supported solutions will be available on Grafana.net, starting with a ",g.a.createElement("a",{href:"http://grafana.net/grafana/plugins/raintank-snap-app"},"Grafana Snap data source")," that is available today."),g.a.createElement("p",null,"âI believe strongly in democratizing metrics, and in open source software. Thatâs why I started writing Grafana. Iâm pleased that we are doubling down on both with todayâs beta launch of Grafana.net.â, said Torkel Odegaard, creator of Grafana and raintank co-founder."),g.a.createElement("p",null,"âEfficient utilization of data center infrastructure is a key benefit of software defined infrastructure,â said Jonathan Donaldson, vice president of software defined infrastructure for Intelâs Data Center Group. âSolutions like Grafana.net deliver improved control of workload assignment based on the underlying physical infrastructure ensuring that each workload is running on an optimal configuration. The collaboration on grafana.net is a great proof point to industry momentum behind Snap and testament of the value of tighter infrastructure management to data center operators.â"),g.a.createElement("p",null,"âWe believe that just like infrastructure software, open source is going to win for monitoring. Snap will be a key piece in our stack, and weâre thrilled to be working on it with Intel.â, said Raj Dutt, raintank co-founder and CEO."),g.a.createElement("h4",null,"About raintank:")